function authorise(params) {
    return new Promise((resolve, reject) => {
        /*   let url = `https://m7c27ovye5.execute-api.eu-west-1.amazonaws.com/Production/authentication`
           fetch(url, {
               method: 'POST',
               mode: "cors",// no-cors, cors, *same-origin
               headers: {
                   "Content-Type" :"application/json"
               },
           })
           .then(response =>{
               return response.json();
           })
           .then(json => {
               console.log(json);
               resolve(json);
           })
           .catch(error => {
               console.log(error);
               reject(error);
           })*/


        var myHeaders = new Headers();
        myHeaders.append("Content-Type", "application/json");

        var raw = JSON.stringify({
            "method": "SIGN_UP",
            "password": "fu",
            "username": "too"
        });

        var requestOptions = {
            method: 'POST',
            headers: myHeaders,
            body: raw,
            redirect: 'follow'
        };

        fetch("https://4i5iljfho7.execute-api.eu-west-1.amazonaws.com/Production/test", requestOptions)
            .then(response => response.text())
            .then(result => console.log(result))
            .catch(error => console.log('error', error));
    });

}

export default authorise;
